import React, { useState } from "react";

const Home = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);

  const handleModalToggle = () => {
    setIsModalOpen(!isModalOpen);
  };

  return (
    <div className="w-full h-screen home flex items-center px-5 lg:px-[72px]">
      <div className="max-w-[450px] md:max-w-[500px] lg:max-w-[600px] flex flex-col gap-7">
        <h1 className="text-[30px] md:text-[40px] lg:text-[50px] font-bold">
          AlerGlow: Pemeriksaan Alergi Kulit Gratis
        </h1>
        <p className="text-text text-[14px] lg:text-[18px]">
          Alerglow adalah aplikasi inovatif yang menggunakan algoritma
          Convolutional Neural Network (CNN) untuk mendeteksi alergi kulit
          dengan akurat. Dengan Alerglow, pengguna dapat dengan mudah mengatasi
          kesulitan dalam mengidentifikasi gejala alergi kulit yang sering
          membingungkan. Aplikasi ini menyediakan solusi efektif dan cepat untuk
          mengetahui jenis alergi kulit yang dialami, membantu pengguna dalam
          merawat kulit mereka dengan lebih baik.
        </p>
        <div>
          <button
            className="py-2 px-8 bg-blue rounded-full"
            onClick={handleModalToggle}
          >
            Coba Sekarang
          </button>
        </div>
      </div>

      {isModalOpen && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white rounded-lg p-8 w-full max-w-md mx-4">
            <h2 className="text-2xl font-bold mb-4">Unggah Foto</h2>
            <input
              type="file"
              className="block w-full text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 cursor-pointer focus:outline-none mb-4"
            />
            <button
              className="py-2 px-8 bg-blue rounded-full"
              onClick={handleModalToggle}
            >
              Prediksi
            </button>
            <button
              className="py-2 px-8 bg-red-500 rounded-full mt-4"
              onClick={handleModalToggle}
            >
              Tutup
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Home;
